import React, { useState, useEffect } from "react";
import "../css/board-create.css";

function CreateForm({ postNewList }) {
    cosnt [list, setList] = useState([]);
    useEffect(() => {
        axios
        .get('/board/list')
        .then((res) => {
        setList(res.data)
        console.log(list)
        })
    }, []);
    return (
    <div class="default_form">
        <form method="post">
        <ul>
          <li>
            제목
            <input type="text" name="title" />
          </li>
          <li>
            사용 언어
            <input type="text" name="skill_stack" />
          </li>
          <li>
            분야
            <input type="text" name="work_field" />
          </li>
          <li>
            모집 인원
            <input type="text" name="max_people" />
          </li>
          <li>
            마감일
            <input type="text" name="end_date" />
          </li>
        </ul>
        <textarea class="create_board" name="content"></textarea>
        <input type="button" onclick={handleCreate} />
        </form>
    </div>
  );
}

export default CreateForm;
